	('buscarPlaneta', 'def', 'hwm', 'buscarPlaneta', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n\r\nSELECT id,nombre, imagen FROM `planet` WHERE id = pId;\r\n\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', 'Busca planeta por ID', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci'),
	('buscarPlanetas', 'def', 'hwm', 'buscarPlanetas', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n 	SELECT id,nombre,imagen \r\n	FROM `planet` \r\n	WHERE nombre like BINARY  CONCAT(\'%\',pCriterio,\'%\')\r\n	ORDER BY id \r\n	DESC LIMIT 1000;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', 'busca planetas por su nombre siempre que contenga el \'criterio\' de busqueda, limit 1000', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci'),
	('deletePlaneta', 'def', 'hwm', 'deletePlaneta', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n\r\nDELETE FROM `planet` WHERE `id`= pId;\r\n\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', '', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci'),
	('getAllPlanetas', 'def', 'hwm', 'getAllPlanetas', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n\r\nSELECT id,nombre,imagen FROM `planet` ORDER BY id DESC LIMIT 1000;\r\n\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', 'ultimos 1000 planetas creados', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci'),
	('insertPlaneta', 'def', 'hwm', 'insertPlaneta', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n\r\n-- inserccion\r\nINSERT INTO `planet` (`nombre`, `imagen`) VALUES (pNombre, pImagen);\r\n-- buscar ultimo id generado\r\nSET pId = LAST_INSERT_ID();\r\n\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', 'Inserccion nuevo planeta', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci'),
	('updatePlaneta', 'def', 'hwm', 'updatePlaneta', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n\r\nUPDATE `planet` SET `nombre`=pNombre,`imagen`=pImagen WHERE `id`=pId;\r\n\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2016-07-27 12:08:40', '2016-07-27 12:08:40', 'NO_AUTO_VALUE_ON_ZERO', '', 'root@localhost', 'utf8mb4', 'utf8mb4_general_ci', 'utf8_general_ci');
